export const satS2H_1 = (s) => {

  const h_ = 1700 //[kJ/kg] 
  const s_ = 3.8 //[kJ/(kgK)] 

  const sigmaA = 1.09 
  const sigmaB = -0.366e-4 

  const etaPow = []
  const sigmaPow = []

  const sigma = s/s_

  const sigma0 = sigma - sigmaA 
  const sigma1 = sigma - sigmaB

  for(let i=1;i<=27;i++){
    etaPow[i] = Math.pow(sigma0, Ia[i])
    sigmaPow[i] = Math.pow(sigma1, Ja[i])
  }

  let eta = 0
  for(let i=1;i<=27;i++){
    eta += na[i] * etaPow[i] * sigmaPow[i] 
  }
  const h = eta * h_

  return h
}

